  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Prime Hook National
  Wildlife Refuge outlines Refuge accomplishments during the 1977 calendar year. The
  report begins with an introduction to the Refuge and information about climatic
  and habitat conditions, land acquisition, system status, funding, and the bicentennial
  land heritage program. The construction and maintenance section discusses maintenance
  and wildfires. Habitat management is covered; croplands, vegetation contorl, grasslands,
  and wetlands are discussed. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, and mammals. Interpretation and recreation
  activities are outlined; topics include information and interpretation, recreation,
  and law enforcement. Field investigations, cooperative programs, and items of interest
  are discussed.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
